import React from "react";

const Home = props => {
  const onButtonClick = () => {
    props.history.push("/form");
  };
  const onButtonClickAbout = () => {
    props.history.push("/about");
  };

  return (
    <>
      <h1>Hello World</h1>
      <button onClick={onButtonClick}>Pushing to Form</button>
      <button onClick={onButtonClickAbout}>Pushing to About</button>
    </>
  );
};

export default Home;
